import{_ as a,o as e,c as t,e as r}from"./chunks/framework.mYMQfzZG.js";const i="/assets/lANnHjHpiYU.08slM0k0.jpg",o="/assets/vQZGwrg2Mdw.8SJIBTFW.jpg",k=JSON.parse('{"title":"Бисквит","description":"","frontmatter":{"title":"Бисквит","date":"2018-09-19","icon":"tBYfeAA6im0.jpg","cover":"YOu41007LBo.jpg","url":"http://www.biskuit.ru","email":"biskuit@biskuit.ru","tel":"+7 812 909 5214","hours":"ежедневно с 11:00 до 22:00","address":"ул. Зверинская, 13/5","place":"м. Спортивная","city":"г. Санкт-Петербург","status":"closed"},"headers":[],"relativePath":"workshop/archive/biskuit/index.md","filePath":"workshop/archive/biskuit/index.md"}'),s={name:"workshop/archive/biskuit/index.md"},h=r('<h3 id="о-студии" tabindex="-1">О студии <a class="header-anchor" href="#о-студии" aria-label="Permalink to &quot;О студии&quot;">​</a></h3><p>Бисквит — это уютная студия в историческом центре Петербурга, недалеко от Петропавловской крепости.</p><p>Ждём вас в гости каждый день, без выходных. А иногда, даже и по ночам. Занятия проходят по предварительной записи.</p><p>Даже если просто идете мимо — заходите на чашечку кофе и поболтать о керамике.</p><h3 id="о-мастерскои" tabindex="-1">О мастерской <a class="header-anchor" href="#о-мастерскои" aria-label="Permalink to &quot;О мастерской&quot;">​</a></h3><p>Авторская керамика Бисквит — это творческий диалог между креативной идеей, дизайном и ручной работой. Постоянный поиск новых сочетаний форм, цветов и фактур. У нас вы можете приобрести уникальные авторские работы современных мастеров художественной керамики.</p><p>Мы готовы воплотить и ваш проект в реальность. Посуда для ресторанов и дома, керамическая плитка, индивидуальная роспись, интерьерные арт-объекты — всё это мы можем создать специально для вас.</p><p>Мы делаем керамику на заказ и можем оформить доставку в любой край мира!</p><p><img src="'+i+'" alt=""></p><h4 id="посуда-для-ресторанов" tabindex="-1">ПОСУДА ДЛЯ РЕСТОРАНОВ <a class="header-anchor" href="#посуда-для-ресторанов" aria-label="Permalink to &quot;ПОСУДА ДЛЯ РЕСТОРАНОВ&quot;">​</a></h4><p>Мы работаем с лучшими шефами и ресторанами авторской кухни России и Европы. У нас нет каталога: мы разрабатываем оргинальный дизайн вместе с шефом.</p><h4 id="керамика-в-интерьере" tabindex="-1">КЕРАМИКА В ИНТЕРЬЕРЕ <a class="header-anchor" href="#керамика-в-интерьере" aria-label="Permalink to &quot;КЕРАМИКА В ИНТЕРЬЕРЕ&quot;">​</a></h4><p>Уникальные вазы, кашпо, плитка, арт-объекты — в керамике нет границ фантазии.</p><h4 id="домашняя-посуда" tabindex="-1">ДОМАШНЯЯ ПОСУДА <a class="header-anchor" href="#домашняя-посуда" aria-label="Permalink to &quot;ДОМАШНЯЯ ПОСУДА&quot;">​</a></h4><p>То, о чём мечтают все, тайно или явно: чтобы на кухне была посуда собственного дизайна и ручной работы.</p><h4 id="авторские-подарки" tabindex="-1">АВТОРСКИЕ ПОДАРКИ <a class="header-anchor" href="#авторские-подарки" aria-label="Permalink to &quot;АВТОРСКИЕ ПОДАРКИ&quot;">​</a></h4><p>Посуду ручной работы, интерьерные объекты, керамические аксессуары и украшения — дарите стильные подарки.</p><h4 id="работа-с-мастером-или-самостоятельно" tabindex="-1">РАБОТА С МАСТЕРОМ ИЛИ САМОСТОЯТЕЛЬНО. <a class="header-anchor" href="#работа-с-мастером-или-самостоятельно" aria-label="Permalink to &quot;РАБОТА С МАСТЕРОМ ИЛИ САМОСТОЯТЕЛЬНО.&quot;">​</a></h4><p>Гончарные круги, жгуты, пласты, глазури и многое другое — вам покажут наши Гуру. Если уже умеете сами — добро пожаловать!</p><h4 id="тематические-мастер-классы" tabindex="-1">ТЕМАТИЧЕСКИЕ МАСТЕР-КЛАССЫ <a class="header-anchor" href="#тематические-мастер-классы" aria-label="Permalink to &quot;ТЕМАТИЧЕСКИЕ МАСТЕР-КЛАССЫ&quot;">​</a></h4><p>Керамика Пикассо? Антонио Гауди? Домашняя посуда? Новогодние игрушки? Да-да!</p><h4 id="керамика-детям" tabindex="-1">КЕРАМИКА ДЕТЯМ <a class="header-anchor" href="#керамика-детям" aria-label="Permalink to &quot;КЕРАМИКА ДЕТЯМ&quot;">​</a></h4><p>Регулярные коллективные занятия керамикой для детей. Развивают мелкую моторику, креативное мышление, фантазию и вкус.</p><h4 id="подарочные-сертификаты" tabindex="-1">ПОДАРОЧНЫЕ СЕРТИФИКАТЫ <a class="header-anchor" href="#подарочные-сертификаты" aria-label="Permalink to &quot;ПОДАРОЧНЫЕ СЕРТИФИКАТЫ&quot;">​</a></h4><p>Подарите на День рождения близкому человеку знакомство с керамикой.</p><p><img src="'+o+'" alt=""></p>',26),l=[h];function n(p,d,c,u,_,b){return e(),t("div",null,l)}const q=a(s,[["render",n]]);export{k as __pageData,q as default};
